Naughty Bookworms - Lily LaBeau 

Release Date: February 21, 2011

Lily wants to participate in the foreign student exchange program this summer in Spain, and she only needs one more teacher's recommendation to become a candidate. But when she asks Professor Pierce to sign off, he's reluctant to recommend her since her grades have not been so good in his course. What are good, however, are her blowjob and humping skills, which Lily demonstrates for her professor. After he gets off, he signs off and Lily says adios.
